import React, { Component } from 'react'

export class AddTodo extends Component {
    render() {
        return (
             <form style={{display: 'flex'}}>
                <input 
                    type="text"
                    name="title"
                    style={{flex: '10'}}
                    placeholder="Add Todo ..."
                />
                <input 
                    type="submit"
                    name="submit"
                    className="btn"
                    style={{flex: '1'}}
                />
            </form>
        )
    }
}

export default AddTodo
